INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Qi-Ladegerät/CSL Qi Stand.webp;', 'CSL Qi Stand', 'https://www.amazon.de/CSL-Stand-Schnellladefunktion-horizontales-%C3%9Cberspannungsschutz/dp/B07PM5F6T2/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1906K167D68HE&keywords=CSL+Qi+Stand&qid=1667039755&qu=eyJxc2MiOiIwLjUxIiwicXNhIjoiMC44MSIsInFzcCI6IjAuOTIifQ%3D%3D&sprefix=galagalago+005%2Caps%2C185&sr=8-1', '14,90', 3.9, 19, 3, '-;CSL Computer;5 Volt, 9 Volt;Tablets;-;USB;-;10 Watt;Der CSL Wireless Charger Qi Stand ermöglicht das kabellose Laden Ihrer Qi-fähigen Mobilgeräte|Unterstützt Fast Charge mit 10W, kompatibel mit Apple, Samsung, LG, HTC, Huawei|Ladeeffizienz von über 70%|Überladungsschutz, Überspannungsschutz, Überhitzungsschutz|Um ein effizientes Aufladen zu garantieren und die Schnelladefunktion mit max. 10W nutzen zu können, wird das Original-Netzteil Ihres Gerätes oder ein anderes Qi-fähiges Netzteil mit Quick-Charge-Ladesystem (QC-Version 2.0/ 3.0) benötigt.');
