8 / Note 7</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">IPhone 14 / 14 Pro / 14 Pro Max / iPhone 13 / 13 Mini / 13 Pro / 13 Pro Max / iPho…</span></span>;USB;1;7.5 Watt;DOPPELTE POWER: Gönn dir blitzschnelles, kabelloses Laden mit einem Ladegerät für Zuhause und einem Ladegerät fürs Büro!|IMMER IM BLICK: Vertikal oder horizontal laden. Ideal für Videos, Nachrichten, E-Mails und in Kombination mit Face ID.|NEED FOR SPEED: Das hochmoderne Chipset garantiert 10W Ladungen für Galaxy und 7,5W Ladungen für iPhones - 10% schneller als vergleichbare Ladegeräte. Für beste Ergebnisse ein Quick Charge 2.0 oder 3.0 (9V/2A) Netzteil verwenden.|HÜLLENFREUNDLICH: PowerWave lädt mühelos durch Schutzhüllen von bis zu 5mm Dicke. Metallzubehör und Kreditkarten können den Ladevorgang einschränken.|WAS DU BEKOMMST: 2 PowerWave Ladeständer, 2 Mikro-USB-Kabel (120cm), eine Bedienungsanleitung, 18 Monate Garantie sowie immer freundlichen Kundenservice. (Netzteil nicht im Lieferumfang enthalten.)');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Qi-Ladegerät/Anker 313 Kabelloser.webp;', 'Anker 313 Kabelloser', 'https://www.amazon.de/Anker-PowerWave-Kabelloses-Ladeger%C3%A4t-Qi-Zertifiziert-Blau/dp/B07THHQMHM/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1NBORYAXHLMKG&keywords=Anker+313+Kabelloser&qid=1667039785&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C125&sr=8-1', '16,99', 4.4, 107775, 1, 'black;Anker;9 Volt;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">AirPods Pro 2 / AirPods / AirPods Pro / Galaxy Buds / Galaxy Buds+/ Pixel 3 / Pixel 3XL / All other Qi-enabled phones and devices</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">AirPods Pro 2 / AirPods / AirPods Pro / Galaxy Buds / Galaxy Buds+/ Pixel 3 / Pix…</span></span>;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">IPhone 14 / 14 Pro / 14 Pro Max / iPhone 13 / 13 Mini / 13 Pro / 13 Pro Max / iPhone 12 / 12 Mini / 12 Pro / 12 Pro Max / SE (2020) / 11/ 11 Pro / 11 Pro Max / XS Max / XR / XS / X / 8 / 8 Plus/Samsung Galaxy S22 / S21 / S20 / S10 / S9+ / S9 / S8 / S8+ / S7 edge / S7 / S6 edge+/ Samsung Note 20 / Note 10 / Note 9 / Note 8 / Note 7</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">IPhone 14 / 14 Pro / 14 Pro Max / iPhone 13 / 13 Mini / 13 Pro / 13 Pro Max / iPho…</span></span>;USB;1;-;DAS ANKER PLUS: Schließe dich den über 30 Millionen glücklichen Kunden an. Lade Anker.|NEED FOR SPEED: Das hochmoderne Chipset garantiert 10W Ladungen für Samsung Galaxy und 7.5W Ladungen für iPhones - 10% schneller als vergleichbare Ladegeräte. Für das beste Ergebnis einfach ein Quick Charge Netzteil (9V/2A) verwenden.|LED-ANZEIGE: Der praktische LED-Indikator hält dich über den Ladeprozess auf dem Laufenden. Leuchtet das Licht blau, stelle bitte sicher, dass sich zwischen deinem Smartphone und der Ladeoberfläche keine Objekte befinden. Leuchtet das Licht grün, bitte ein 5V/2A Netzteil verwenden oder ein anderes Ladekabel ausprobieren.|HÜLLENFREUNDLICH: PowerWave lädt mühelos durch Schutzhüllen von bis zu 5mm Dicke. Metallzubehör und Kreditkarten können den Ladevorgang einschränken.|WAS DU BEKOMMST: Ein PowerWave Ladepad, ein 120 cm langes Mikro-USB-Kabel, 18 Monate Garantie und immer freundlichen Kundenservice.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Qi-Ladegerät/Anker 313.webp;', 'Anker 313', 'https://www.amazon.de/Anker-Ladekabel-kompatibel-MacBook-Nintendo/dp/B09H2DMR4K/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1A9BT6SNZFO93&keywords=Anker+313&qid=1667039798&qu=eyJxc2MiOiIyLjcxIiwicXNhIjoiMi41OCIsInFzcCI6IjIuNDQifQ%3D%3D&sprefix=nanami+a800%2Caps%2C87&sr=8-3', '16,99', 4.5, 172, 0, 'black;Anker;-;Tablet, Smartphone;-;-;-;-;DAS ANKER PLUS: Schließe dich den über 65 Millionen glücklichen Fans an. Lade Anker.|UNTERSTÜTZT POWER DELIVERY: Gönn’ dir bis zu 60W High-Speed Ladeleistung für all deine USB-C Geräte. (Mit einem USB-C-Netzteil verwenden.)|UNIVERSELLE KOMPATIBILITÄT: Kompatibel mit allen USB-C Geräten, wie zum Beispiel Smartphones, Tablets und Laptops. (Nur für Ladeenergie konzipiert, nicht für Media-Display geeignet.)|ABSOLUT STRAPAZIERFÄHIG: Mit seiner erstklassigen Ausdauer von über 12.000 Biegungen und Zerrungen lebt dein Ladekabel bestimmt viel länger als dein Smartphone.|WAS DU BEKOMMST: Ein Anker 313 USB-C auf USB-C Ladekabel (30cm, Nylon), Kabelbinder, Bedienungsanleitung.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Qi-Ladegerät/TOZO W1.webp;', 'TOZO W1', 'https://www.amazon.de/TOZO-W1-Induktions-Ladeger%C3%A4t-Aluminium-Matt-schwarz/dp/B08J49THFB/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=34HMLFVFJF7GI&keywords=TOZO+W1&qid=1667039804&qu=eyJxc2MiOiIyLjQ0IiwicXNhIjoiMi4wMiIsInFzcCI6IjEuOTIifQ%3D%3D&sprefix=anker+313%2Caps%2C75&sr=8-3', '16,99', 4.2, 83477, 0, 'black;TOZO;-;Tablets, Handys;Nokia Lumia 1020, LG G4;-;1;10 Watt;【Ultra Schlank】Unser Schlankstes kabelloses Ladegerät, nur 5 mm bis dick. Haltbare Glasplatte und Gehäuse aus Aluminium in Luftfahrtqualität. Einfach und modisch.|【Sicher und zuverlässig】Eingebauter Überladungs-, Überhitzungs- und Kurzschlussschutz.|【Entlasten Sie Ihren Raum】 Machen Sie sich frei von Steckern und Kabeln und sorgen Sie dafür, dass Ihr Desktop ordentlich und organisiert bleibt. Unterstützt schnelles Laden (Ladegerät nicht im Lieferumfang enthalten).|【LED-Anzeige leuchtet】 Ändern der Farbe Atem LED leuchtet. Informiert Sie, wenn es bereit ist, aufzuladen, aufzuladen und wenn Ihr Gerät völlig aufgeladen ist.|【Universell Einsetzbar】Unterstützt alle aktivierten drahtlosen Ladegeräte oder Geräte mit Empfänger wie iPhone 11/11 Pro / 11 Pro Max / XS MAX / XR / XS / X / 8, Samsung Galaxy Galaxy Note 10 / Note 10 Plus / Note8 / Note9 / S10 / S10 Plus / S10E / S9 / S9 Plus/ S8 / S8 Plus / S7 / S7 Edge / Note 5, LG G4, S6, S6 Edge, S6 Edge Plus, Nexus 6, Moto Droid Turbo, Nexus 5/7 (2013 ) / 4, Nokia Lumia 1020/920/928, MOTO Droid Maxx / Droid Mini und andere fähige Handys und Tablets.');
