 Pro Max/13 Mini/12/12 Pro/12 Pro Max/SE 2020/11/11 Pro/11 Pro Max/XS MAX/XS/XR/X/8/8 plus; Samsung Galaxy S22/S21/S21 Plus/S21 Ultra/S20 fe/S20/ S20+/S20 Ultra/S10 +/S10/S10e/S9/S9 plus/S8/S8 plus/S7/S7 Edge/S7 Active/S6/S6 Edge Plus/S6 Active/Note5/Note7/Note8/ Note9/Note10/Note10+; Huawei Mate 30 RS/Mate 20 Pro/Mate 20 RS/P30 Pro/Mate 30/Mate 30 Pro; xiaomi 12/xiaomi 11/ xiaomi 10/xiaomi 9/xiaomi mix 2S/xiaomi mix 3/9 Pro 5G; Oneplus 8 pro/Oneplus 9 pro/Oneplus 10 pro; LG V50 ThinQ/ V50;LG V40 ThinQ/ V35;LG G8 ThinQ/ G8 ;LG G7 ThinQ/ G7 usw.</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">IPhone 14/14 Plus/14 Pro/14 Pro Max/13/13 Pro/13 Pro Max/13 Mini/12/12 Pro/12 Pro Max/SE 2020/11/11 Pro/11 Pro Max/XS MAX/XS/XR/X/8/8 plus; Samsung…</span></span>;-;1;10 Watt;【2 Spulen Wireless Gerät bietet viel breiter Laderaum】: NANAMI M220 FAST Wireless-Ladegerät ist mit zwei Sendespulen ausgestattet, die effektiver die drahtlose Ladebereich für die vollständige Richtungsleistung abdecken wird, können Sie Ihr Telefon mit einer freien Position platzieren können, ohne die Notwendigkeit für eine perfekte Ausrichtung. Es kann auch als valentinstag geschenk für sie oder ihn, um Freunde und Angehörige als Geschenk zu verschenken.|【Schnelle Laden &amp; kompatible Modelle】: NANAMI schnelle drahtlose Ladegeräts können Sie Ihre Geräte um 40% schneller mit schnellen drahtlosen Lade Standard aufladen,kompatibel zu Samsung Galaxy S22/S21/S21 Plus/S21 Ultra/S20/S20 fe/S20+/S10/S10+/S9/S9+/S8/S8+/S7/Note 20/10.Zusätzlich ist es auch kompatibel zu allen Qi-fähigen Geräte mit Standard-Ladegeschwindigkeit, wie iPhone Serie 14 &amp; 13/12/12 Pro/12 Pro Max/11/11 Pro/11 Pro Max/XS/XS Max/XR/X/8 Plus/8;Xiaomi 12/11;Oneplus 10 pro/9 pro;LG,HTC.|【Segeln Design Inspiration &amp; Diamant Schleifens Surface】: Diese induktions ladegerät herausragende Design ist die Modellierung als Segelyacht, die für Freiheit und Leidenschaft des Lebens stehen. Diamantschneidfläche es Concise und stark zu machen. Es bietet die beste Blickwinkel des Bildschirms macht es einfacher, um Filme zu sehen oder E-Mails lesen, während des Ladens.|【Hohe Wireless Ladeeffizienz 】: Neueste Smart Control Chip sorgt für eine hohe Conversion-Rate von 80%. Erbaut in über Lade- und Überschlagschutz Temperaturkreis , überlädt nie Ihre Batterie oder verschwendet Energie, absolut umweltfreundlich . Funktioniert mit den meisten Arten von Gehäusen wie Gummi-Hülle, Ultra-Hybrid-Gehäuse, Kunststoff / TPU / PC-Gehäuse; DARF NICHT dicker sein als 5mm.|【Qualität Versicherung &amp; Garantie】: CE, RoHS, FCC zertifiziert. Erbaut im Überladung und Übertemperaturschutz Schaltung. FULL NANAMI 18 Monate Garantie und Premium-Kundenservice und Lebensdauer unterstützen. Absolut ein Risikofreier Kauf für Sie.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Qi-Ladegerät/Anker PowerPort Qi.webp;', 'Anker PowerPort Qi', 'https://www.amazon.de/Anker-PowerPort-Ladeger%C3%A4t-Induktive-Ladestation-schwarz/dp/B010U7ACHI/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2MIM60U9PL3QL&keywords=Anker+PowerPort+Qi&qid=1667039826&qu=eyJxc2MiOiIyLjIzIiwicXNhIjoiMS4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C74&sr=8-3', '13,99', 4.2, 3434, 0, 'black;Anker;5 Volt;Handys;Apple iPhone 8, Samsung Galaxy S9, Apple iPhone XS Max;USB;1;-;DAS ANKER PLUS: Schließe dich den über 30 Millionen glücklichen Kunden an. Lade Anker.|MÜHELOS LADEN: Der Ladevorgang startet automatisch, sobald ein Gerät auf das Ladepad gelegt wird. Kein Kabel notwendig.|HOCHMODERNE TECHNOLOGIE: Die Temperaturregulierung aktiviert sich bei 41°C um Ihre Geräte zu schützen. Die fortschrittliche Temperaturregulierung sorgt für absolute Sicherheit - für dich und deine Geräte. Der effiziente Leerlaufmodus spart gleichzeitig Energie und schützt vor Überladung.|AUF DEM LAUFENDEN: Leuchtet die LED-Lampe rot, ist das Ladegerät zum Laden bereit. Blau signalisiert den Ladevorgang. Leuchten beide LED-Lichter zusammen, ist das Gerät vollständig geladen. Blinkendes LED-Licht zeigt ein nicht unterstütztes Gerät an.|WAS DU BEKOMMST: Ein Anker PowerPort Ladegerät, ein Mikro USB Kabel, eine Bedienungsanleitung, 18 Monate Garantie sowie immer freundlichen Kundenservice.');
