 Serie, Nicht für 14 Pro|Sicherer Magnetverschluss: Starke Magnete mit 1.400 g Haftkraft halten dein Handy auch bei Fahrten auf holprigen Straßen sicher an Ort und Stelle; kombiniere es mit einer HaloLock Hülle für einen noch stärkeren magnetischen Halt|Bereit für die Navigation: Voller Magnetring und verstellbares Kugelgelenk ermöglichen dir den Zugriff auf eine Vielzahl von Winkeln und Ausrichtungen, um sicherzustellen, dass du immer die bequemste Sicht hast');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Qi-Ladegerät/Auckly 15W Fast Wireless Charger.webp;', 'Auckly 15W Fast Wireless Charger', 'https://www.amazon.de/Auckly-Handyhalterung-Ladefunktion-Automatischer-Ladestation/dp/B08GY1VLDK/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=KBZQCS33FV6W&keywords=Auckly+15W+Fast+Wireless+Charger&qid=1667039841&qu=eyJxc2MiOiIxLjkxIiwicXNhIjoiMS41NiIsInFzcCI6IjEuNDkifQ%3D%3D&sprefix=auckly+15w+fa%2Caps%2C134&sr=8-3', '36,99', 4.3, 14527, 1, 'Auckly;9 Volt;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">✔ Passt auf 99 % der Luftauslässe im Auto (siehe sechstes Hauptbild);✔ Wichtig! !Achtung:&gt;&gt;1. QC3.0 Feuerzeuge &gt; 18W müssen verwendet werden! Andernfalls kommt es zu Ladeproblemen (Auto-USB kann nicht verwendet werden!) (nicht im Lieferumfang enthalten); &gt;&gt;2. Die Länge des Tretlagers muss entsprechend der Größe des Mobiltelefons angepasst werden, bis es normal geladen werden kann.</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">✔ Passt auf 99 % der Luftauslässe im Auto (siehe sechstes Hauptbild);✔ Wichtig! !Achtung:&gt;&gt;1. QC3.0 Feuerzeuge &gt; 18W müssen verwendet werden! Andernfalls kommt es zu Ladeprob…</span></span>;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">✔Unterstützt alle Mobiltelefone mit kabelloser Ladefunktion. (Zusätzlich zu allen Klapphandys, wie z. B. Samsung "Galazy Z");✔für iPhone 14/iPhone 14 Pro/iPhone 14 Pro Max/iPhone 14 Plus;iPhone 13/13 Pro/13 Pro Max/13Mini/12 Mini/12 Pro/12 Pro Max / 12/11 Pro / 11 Pro Max /SE (2. Generation 4,7 Zoll) /XR / XS MAX / 11 / XS / 8 / 8plus / X; ✔für Samsung S S6 / S6 edge / S6 Active / S7 / S7edge / S7 Active / S8 / S8+ / S8 Active / S9 / S9+ / S10 / S10+ / S10E / S10LITE / S20 / S20+ / S20 Ultra 5G / S20 + 5G / Note10 + / S21 / S21 + 5G / S21 Ultra / S20 FE; ✔für Samsung Note Galaxy NOTE 5 / NOTE 7 / NOTE 8 / NOTE 9 / Note10 / Note10 + 5G / NOTE FE / Note20 / Note20 Ultra 5G; ✔für OPPO Find X3 Rro /Find X3 /Find N /Ace2 /Ace /VIVO X70 PRO+; ✔Xiamo Mi 12/12 Pro /10S / 11/11 Ultra / 8/9 Pro / 10 Pro / 10 /MIX4; ✔für OnePlus 10 Pro 5G/9 /9R /9RT /9R /9pro / 8 Pro 5G ✔SONY Xperia XZ2 / XZ3 / Z3V / Z4V für LG G Pro / G2 / G3 / G5 / G6 / G6 + / G7 ThinQ / G7 + ThinQ / G8 / G8 ThinQ / G8S / G8S ThinQ / G8X / G8X ThinQ / V30s ThinQ / V30 / V30 + / V35 ThinQ / V35 / V40 ThinQ / V50 / V50 ThinQ / V50S; für Google Nexus4/Nexus5/Nexus6/Nexus 7/Pixel 3/Pixel 3XL/Pixel 4/Pixel 4XL/Pixel 5/Pixel 6/Pixel 6 Pro; ✔HUAWEI P40 Pro + / 40 Pro / Mate 40E / Mate 40 RS / Mate RS / MATE20 PRO / P30 PRO / V30 PRO / MATE30 PRO / MATE30 / p40pro 5G / V30 / PRO / Ehre - V30 PRO / Ehre 30 Pro + / V40; ✔ für HTC Droid DNA (US Edition) / 8X (US Edition) / One M8 Eye (M8Et) / One E9 (E9t) / Butterfly 3; ✔Nokia Lumia 929/1020/1520/925/928/720/930/830/820/920 ---Kompatible Telefonmodelle Da es zu viele Modelle gibt, kann ich sie nicht alle auflisten, unterstützen alle Mobiltelefone mit kabellosem Laden Funktion (Marke ist nicht begrenzt)</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">✔Unterstützt alle Mobiltelefone mit kabelloser Ladefunktion. (Zusätzlich zu allen Klapphandys, wie z. B. Samsung "Galazy Z");✔für iPhone 14/iPhone 14 Pro/iPhone 14 Pro Max/iPhone…</span></span>;Kabelloses Laden;-;🚗【Automatische Schließung durch elektromagnetische Induktion &amp; Berührungsschalter】 Mit automatischer elektromagnetischer Induktion kann die Klemmarme sich automatisch öffnen und schließen. Die automatische Schließfunktion wird durch Fremdkörpererkennung (FOD) verwirklicht. Dadurch ist die Klemmarme stabiler und mit höher Technologie im Vergleich zum alten Produkt und wird sich nicht selbst wieder öffnen. 🚗Unter den Klemmarmen befinden sich 2 Metallknöpfe zur Aktivierung der Klemmarme.|🚗【15 W Superschnelle Ladung &amp; Schnelle Wärmeableitung】 15 W kabellose Schnellladung, mit dem Hauptsteuerchip HC5703C, optimiert von 5V1A auf 9V2A, und die maximale Leistung erreicht 15W. 🚗Die maximale Eingangsleistung bei iPhones ist 7,5 W, bei Samsung und andere Handys mit Android-System kann sie 10 W erreichen, und für Xiaomi 9, LG v50 usw. kann sie sogar 15 W sein (Verwenden Sie ein QC3.0 Autoladegerät mit Leistung über 18 W). Hinweis: Huawei 15W Schnellladung wird nicht unterstützt.|🚗【Leichte Abnahme des Handys auch im Stillstand mit dem Superkondensator &amp; Leiser Motor】 Dank dem eingebauten Superkondensator können Sie beim Stillstand des Autos die Klemmarme noch elektrisch öffnen und Ihr Handy leicht herausnehmen. Hinweis: Der Kondensatorbatteriestand genügt nur für zwei- oder dreimalige Einschaltungen.🚗 Der Motor ist von Typ C914 mit der neuesten Technologie, und sein Lärm ist weniger als 20 dB. Zudem wird die Lebensdauer des Motors um 6 Jahre verlängert.|🚗【Clip aus Aluminiumlegierung &amp; Verstellbare Palette】 Statt traditionellen Luftauslassklammern aus Kunststoff, verwenden wir Klammern aus reiner Aluminiumlegierung, die unsere Zerstörungsprüfung perfekt bestanden haben. Sie können die Klammern um 360 Grad drehen und der Bildschirm kann im Querformat (horizontal) angezeigt werden. 🚗Die Palette ist streckbar, und es wird empfohlen, die Palette zur geeigneten Skala gemäß der Größe des Handys einzustellen, um den besten Ladeeffekt zu erzielen.|🚗【Garantie für 24 Monate &amp; Qi-zertifiziert】 Wenn Sie innerhalb von 2 Jahren auf irgendeine Produktprobleme stoßen, kontaktieren sie uns bitte, wir werden Ihnen qualitativ hochwertigen Service bieten und neue Produkte für Sie austauschen. 🚗Die kabellose Autoladegeräthalterung von Auckly entspricht zu 100% den EU-Standards und hat die nationalen Zertifizierungen von Qi-, CE-, FCC- und ROHS-Standards erhalten.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Qi-Ladegerät/YOSH Kabelloses Auto Ladegerät.webp;', 'YOSH Kabelloses Auto Ladegerät', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo4MzAyNjIzNjkyMjg0ODA2OjE2NjcwMzk4NjE6c3BfYXRmOjIwMDg0MTY2NTU1Njk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FYOSH-Autoladehalterung-Magnetisches-Autohalterung-Verschluss-Clip%2Fdp%2FB0BBGXYVRK%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3I5O8UBA1DMG2%26keywords%3DYOSH%2BKabelloses%2BAuto%2BLadeger%25C3%25A4t%26qid%3D1667039861%26qu%3DeyJxc2MiOiIxLjA1IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dyosh%2Bkabell%252Caps%252C97%26sr%3D8-1-spons%26psc%3D1', '29,99', 4.7, 5, 3, 'YOSH;-;Smartphones;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">IPhone 14 Pro Max/ 14 Pro/ 14 Plus/ 14/ 13 Pro Max/13 Pro /13 /13 mini /12 Pro Max /12 Pro /12 /12 mini /Mag-Safe-Hüllen</span><span class="a-truncate-cut" aria-hidden="true" style="height: auto;">IPhone 14 Pro Max/ 14 Pro/ 14 Plus/ 14/ 13 Pro Max/13 Pro /13 /13 mini /12 Pro Max /12 Pro /12 /12 mini /Mag-Safe-Hüllen</span></span>;-;-;⚡【Entworfen für iPhone 14/13/12 Serie】YOSH Magnetische drahtlose Ladegerät Vent Halter ist speziell für iPhone 14 Pro Max / 14 Pro / 14 Plus / 14, 13 Pro Max / 13 Pro / 13 Mini, iPhone 12 Pro Max / 12 Pro / 12 / 12 mini, auch kompatibel mit Mag -Sicheres Gehäuse (mit eingebauten Magneten)|⚡【Leistungsstarke Magnetische Adsorption】Der Halter verwendet 16 x N52 Ringmagnete, 0,1S automatische Ausrichtung, Adsorption und Aufladung. Der eingebaute Magnet unterscheidet sich von gewöhnlichen Magnethaltern, ohne dass ein Eisenblech aufgeklebt werden muss, wodurch Ihr Telefon besser geschützt wird.|⚡【Stabiler Doppelter Entlüftungsclip] Der verbesserte】 YOSH 2022 Doppelverschluss-Clip sorgt für hohe Stabilität und der Clip hat ein eingebautes rutschfestes Silikon, um die Lüftungsschlitze Ihres Autos zu schützen und den Halter während der Fahrt nicht herunterfallen zu lassen. Und diese Autohalterung ist für die meisten Lüftungsdüsen im Auto geeignet (Hinweis: nicht geeignet für einige runde Lüftungsdüsen mit unregelmäßigen Lamellen)|⚡【Schnelles kabelloses Ladegerät】15W Schnellladung in ca. 2 Stunden, kabelloses Laden mit einzigartigem Kühlchip und spezieller Magnetplatte, keine Interferenzen, effizienteres Laden. 18W QC-Adapter für Schnellladung erforderlich (nicht enthalten)|⚡【Einhändige Installation】Die kabellose YOSH-Autoladehalterung hat ein filigranes und kompaktes Design, das mit einer Hand bedient werden kann, ohne die Sicht zu behindern. Das Telefon kann um 360° horizontal und vertikal verstellt werden, um Ihnen ein möglichst sicheres und komfortables Fahrerlebnis zu bieten.|⚡【Paket Enthält】Magnetkopf zum kabellosen Laden×1, Universal-Kugelauslassclip×1, 1m Typ-C-Datenkabel×1, Anleitungskarte×1, Staubaufkleber×1');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Qi-Ladegerät/NANAMI Kabelloses Autoladegerät.webp;', 'NANAMI Kabelloses Autoladegerät', 'https://www.amazon.de/L%C3%BCftungsschlitz-Clip-NANAMI-67-Zoll-Kugelkopf-Autoladeger%C3%A4t-Halterung-Autotelefonhalter-Weltraum-Grau/dp/B07FX4Y6Q7/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=31FSSS7OUI60D&keywords=NANAMI+Kabelloses+Autoladeger%C3%A4t&qid=1667039870&qu=eyJxc2MiOiIxLjI3IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=nanami+kabell%2Caps%2C155&sr=8-3', '5,99', 4.0, 10, 0, 'NANAMI;220 Volt;Handys;-;-;-;【BREITE KOMPATIBILITÄT】NANAMI Ersatz-Autohalterungsclip mit einem 0,67 Zoll (17 mm)Kugelkopf, perfektem kabellosen Autoladegerät, Autotelefonhalter, Garmin Nuvi-GPS-Geräten und vielem mehr.|【360° GRAD EINSTELLBARER BLICKWINKEL】 Mit dem drehbaren Kugelkopf kann die Autohalterung um 360 ° gedreht werden, damit können Sie Ihr Handy flexibel zu allen Richtungen drehen, um eine passende Blickwinkel zu sich zu verstellen.|【100% SATISFACTION GUARANTEE 】Genießen Sie 60 Tage GELD-ZURÜCK-GARANTIE für jedes Produktproblem. 24 Stunden freundlicher Kundendienst. Bei NANAMI gilt die ZERO Risk-Kaufgarantie für das Lächeln jedes Kunden.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Qi-Ladegerät/Hinyx Kabelloses Auto-Ladegerät.webp;', 'Hinyx Kabelloses Auto-Ladegerät', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo3OTk2ODMyMzYzNzY1NTY4OjE2NjcwMzk4Nzk6c3BfYXRmOjIwMDc0MTMyNzQ2Nzk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FHinyx-Kabelloses-Schnellladung-Automatisches-Handyhalter%2Fdp%2FB08F24LJDM%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3LXLUGZFFV70K%26keywords%3DHinyx%2BKabelloses%2BAuto-Ladeger%25C3%25A4t%26qid%3D1667039879%26qu%3DeyJxc2MiOiIxLjczIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dhinyx%2Bkabel%252Caps%252C103%26sr%3D8-1-spons%26psc%3D1', '31,99', 4.2, 1417, 0, 'Hinyx;9 Volt;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">[Kompatibel mit Samsung] Galaxy S21/S21 Plus/S21 Ultra/Z Flip/Z Fold 2/Fold/Note 20/Note 20 Ultra/S20/S20 Plus/S20 Ultra (5G)/S20 FE/Note 10/Note 10 Plus/S10/S10e/S10 Plus/Note 9/S9/S9 Plus/Note 8/S8/S8 Active/S8 Plus/S7/S7 Active/S7 Edge/S6/S6 Active/S6 Edge/S6 Edge Plus, Samsung Leader 8/W2016; [Kompatibel mit Google] Pixel 5/Pixel 4 XL/Pixel 4/Pixel 3 XL/Pixel 3/Nexus 6/Nexus 5/Nexus 4;, [Kompatibel mit Apple] iPhone 12/12 Pro/12 Pro Max/12 Mini/13/13 Pro/13 Pro Max/13 Mini/SE/11/11 Pro/11 Pro Max/Xr/Xs/Xs Max/X/8/8 Plus；, [Kompatibel mit Huawei] P40 Pro/Mate 30 Pro/Mate 30/P30 Pro/Mate RS Porsche Design/Mate 20 Pro; [Kompatibel mit Xiaomi] Mi 10 Pro/Mi 10/Mi 9/Mi MIX 3/Mi MIX 2S; [Kompatibel mit ZTE] Axon 9 Pro/Telstra Tough Max; [Kompatibel mit HTC] Windows Phone 8X/Droid DNA; [Kompatibel mit DOOGEE] S95 Pro/S90 Pro/S90/S68 Pro/S80 Lite/S80/S70 Lite/S70/S60 Lite/S60/BL9000;, [Kompatibel mit LG] V60 ThinQ/V50 ThinQ/V40 ThinQ/V30 Plus/V30/Vu 3/Vu 2/Spectrum 2/Optimus It L-05E/Optimus G Pro/Optimus F5/Lucid 3/Lucid 2/G7 ThinQ/G7/G6 Plus/G6/G3/G2; [Kompatibel mit Motorola] Edge+/Moto X Force/Moto Maxx/Droid Turbo 2/Droid Turbo/Droid Mini/Droid Maxx; [Kompatibel mit Sony] Xperia XZ3/Xperia XZ2 Premium/Xperia XZ2/Xperia Z4V/Xperia Z3V; [Kompatibel mit Nokia] 9 PureView/8 Sirocco/Lumia 930/Lumia 929 (Icon)/Lumia 928/Lumia 920/Lumia 830/Lumia 735/Lumia 1520;, [OnePlus] 8Pro; [Microsoft] Lumia 950 XL Dual Sim/Lumia 950 XL/Lumia 950 Dual Sim/Lumia 950; [[Panasonic] Eluga X1 Pro/Eluga X1/Eluga X P-02E/Eluga V P-06D/Eluga P P-03E; [BlackBerry] Z30/PRIV/Passport; Alle anderen Qi-fähigen Telefone</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">[Kompatibel mit Samsung] Galaxy S21/S21 Plus/S21 Ultra/Z Flip/Z Fold 2/Fold/…</span></span>;Google Nexus 4, Apple iPhone XS, Google Pixel 3;USB;15.00;⚡ [2-in-1 Schnelles kabelloses Laden] Das kabellose Auto-Ladegerät kann das Telefon nicht nur wie eine Handyhalterung halten, sondern auch zum Aufladen des Telefons mit dem kabellosen Ladegerät verwendet werden. Kompatibel mit allen Handys, die Qi 4,7-6,7 Zoll kabelloses Laden unterstützen, für iPhone 13/13 Pro /13 Pro Max/ 13 Mini/ 12/12 Pro/ 12 Mini/ 12Pro Max/ SE/ 11/11Pro/ 11Pro Max/ Xs Max/ XS/XR/ X/ 8P/ 8, Samsung S2 0 / S10. / S9/ S9+ / S8/ S7/ Note10/ Note9/ Note8/ Note7, Google Nexus 4/ Nexus 5/ Nexus 6/ Pixel 3/4, LG v50/G7|⚡ [Auto-Sensing Teleskoparme] Qi kabelloses Auto-Ladegerät mit eingebautem intelligentem Chip. Die Einhandbedienungsfunktion, die die Bedienung des Telefons während der Fahrt erheblich erleichtert. Alles, was Sie tun müssen, ist, Ihr Telefon auf die Halterung zu legen und die Klemme wird es automatisch greifen und das Telefon beginnt zu laden. One-Touch-Entriegelung, die den hinteren Sensorbereich des Kfz-Ladegeräts berührt, um das Telefon zu entfernen, ohne das Gerät zu entfernen|⚡ [Kompatibilität und Sicherheit] Die Hülle muss zum kabellosen Laden nicht entfernt werden, geeignet für die meisten Handyhüllen, aber keine Metallaufsätze, bitte halten Sie die Hülle dick ≤ 6 mm für eine bessere Ladeeffizienz. Es gibt Silikon-Material am Griffarm und an der Unterseite, um den Anti-Rutsch-Effekt zu verbessern. Dieses Handy-Ladegerät bietet mehrere Schutzfunktionen, es ist mit Überstrom, Überhitzung, Kurzschluss und Überspannung ausgestattet, um eine sichere, einwandfreie Ladung zu gewährleisten|⚡ [360 ° drehbare KFZ-Handyhalterung] Das kabellose Ladegerät kann mit Befestigungsclip am Lüftungsschlitz installiert werden, geeignet für die meisten Lüftungsschlitze, so dass Sie es in jedem Fahrzeug verwenden können. 360° Kugelgelenk-Drehgelenk ermöglicht einfaches Drehen und Positionieren Ihres Telefons für optimale Sicht und einfachere Nutzung von Funktionen, wie GPS und Telefongesprächen, freie Hände|⚡[Was Sie erhalten] Wenn es irgendein Problem mit dem Produkt gibt, zögern Sie nicht, uns zu kontaktieren, Hinyx verspricht Ihnen 12 Monate aufrichtigem Service zu bieten und neue Produkte direkt für Sie zu tauschen. Hinyx zertifiziert durch Qi, CE, FCC, RoHS 🚗 Was Sie erhalten: 1 x kabelloses Auto-Ladegerät; 1 x QC 3.0 Auto-Ladegerät-Adapter; 1 x Lüftungsschlitz-Clip; 1 x Typ-C-Kabel; 1 x Bedienungsanleitung (evtl. nicht in deutscher Sprache)');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Qi-Ladegerät/Beeasy 15W Fast Wireless Charger.webp;', 'Beeasy 15W Fast Wireless Charger', 'https://www.amazon.de/Beeasy-Ladestation-Handyhalter-Kabelloses-Kompatibel/dp/B07WVTFX41/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2FP8NOFGJ27BQ&keywords=Beeasy+15W+Fast+Wireless+Charger&qid=1667039888&qu=eyJxc2MiOiIwLjk3IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=beeasy+15w+fast+w%2Caps%2C112&sr=8-3', '29,99', 4.1, 514, 0, 'Beeasy;9 Volt;Renault, Peugeot, Citroen, Volkswagen, Ford, Chevrolet, GM, Subaru, Benz, KIA usw;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">Für iPhone 14 / 14 Plus / 14 Pro / 14 Pro Max / 13 / 13 Pro / 13 Pro Max /13 Mini /12 / 12 Pro / 12 Pro Max / 12 Mini / 11 / 11 Pro / 11 Pro Max /SE 2022 / SE 2020 / XR / XS Max / XS / X / 8 Plus / 8, Für Samsung Galaxy S22 Ultra / S22 Plus / S22 / S21 Ultra / S21 Plus / S21 / S21 FE / S20 FE / S20 Ultra / S20 Plus / S20 / S10 Plus / S10, Galaxy Note 20 Ultra / Note 20 / Note 10 Plus / Note 10, Für Xiaomi Mi 12 / 12 Pro /10S / 11 / 11 Ultra / 8 / 9 Pro / 10 Pro / 10 / MIX4; Für OnePlus 9 Pro / 8 Pro 5G; Für Google Pixel 3 / Pixel 3XL / Pixel 4 / Pixel 4XL / Pixel 5 / Nexus4 / Nexus5 / Nexus6 / Nexus7; Für Huawei P40 Pro/ P30 Pro/ P30/ Mate 30 Pro/ Mate 30/ Mate 20 Pro; Für LG G Pro / G2 / G3 / G5 / G6 / G7 / G7 ThinQ / G8 / G8 ThinQ / G8S / G8X ThinQ / V30 / V35 ThinQ / V40 ThinQ / V50 / V50S; Für SONY Xperia XZ2 / XZ3 / Z3V / Z4V; Für Nokia Lumia 920/ 928/ 929/ 930/ 1020/ 1520</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">Für iPhone 14 / 14 Plus / 14 Pro / 14 Pro Max / 13 / 13 Pro / 13 Pro Max /13 Mini…</span></span>;Wireless;7.5 Watt;⚡【Qi Drahtlos Ladegerät &amp; Handy Halterung】 2-IN-1-Design Kombiniert das Qi Drahtlos Ladegerät und eine Handyhalterung. Eingebaute große Kupferspule. Es lädt Ihr Gerät bis zu 1,5-mal schneller als herkömmliche kabellose Ladegeräte im Auto.|⚡【15W Drahtlos Schnell Auto-Ladegerät】 Max 15W für Xiaomi Mi 11/Mi 9/LG V50/G8 usw. 10W für Samsung Galaxy S22 Ultra/S22/S21 Ultra/S21/S20 FE/S10/Note 20 Ultra/Note 10 usw. 7.5W für iPhone 14/14 Plus/14 Pro/14 Pro Max/13/13 Pro Max/12/12 Pro Max/11/XS/XR/8 Plus usw. (QC 2.0/QC 3.0 Auto Ladegerät ist erforderlich.)|⚡【Stabiles Aufladen &amp; Mehrfacher Schutz】 Mit intelligenter interner Chips, kann es automatisch des Niveaus vom Strom Ihres Geräts entsprechen. Es bietet ideale Temperaturregelung, Überspannungsschutz, Überladeschutz und Kurzschlussschutz an. Sie können fahren und gleichzeitig Ihr Handy aufladen, auch wenn Sie auf einer holprigen Straße fahren.|⚡【Ultra-Klebriger Saugnapf】 Der klebrige Boden und der Saugnapf sorgen für eine starke Haftung und stellen sicher, dass das Handy und die Halterung während der Fahrt verriegelt bleiben. Der klebrige Boden kann gereinigt werden, um die Nutzung zu verlängern. Spülen Sie es einfach mit Wasser ab und trocknen an der Luft, um die Viskosität wiederherzustellen.|⚡【Was erhalten Sie?】 1*Beeasy Auto Ladegerät Halterung, 1*USB-C-Kabel, 12 Monate Garantie und lebenslanger Kundenservice. Bei Fragen wenden Sie sich bitte an unseren freundlichen Kundensupport.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Qi-Ladegerät/Polmxs Wireless Charger.webp;', 'Polmxs Wireless Charger', 'https://www.amazon.de/Ladestation-Handyhalterung-Ladefunktion-Rutschfester-Ladeger%C3%A4t/dp/B09BVPG5ZL/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=B20X68XW3C4S&keywords=Polmxs+Wireless+Charger&qid=1667039894&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C78&sr=8-3', '24,99', 3.8, 256, 0, 'Polmxs;9 Volt;Alle Qi-fähigen Telefone, Airpods und andere Geräte;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">IPhone 14/14 Plus/14 Pro/14 Pro Max 13/13 Pro/13 Pro Max/13 Mini/12/12 Pro/12 Pro Max/12 Mini/SE/11/11Pro/11 Pro Max/Xr/Xs/ Xs Max/X/8/8 Plus; Samsung Galaxy S22/S22 Ultra/S21/S21 Plus/S21 Ultra/Note 20/Note 20 Ultra/S20/S20 Plus/S20 Ultra(5G)/S20 FE/Note 10/Note 10 Plus/S10/S10e/S10 Plus/Note 9/S9/S9 Plus/Note 8/S8/S8 Active/S8 Plus/S7/S7 Active/S7 Edge/S6/S6 Active/S6 Edge/S6 Edge Plus und andere Qi-fähige Geräte</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">IPhone 14/14 Plus/14 Pro/14 Pro Max 13/13 Pro/13 Pro Max/13 Mini/12/12 Pro/12 Pro Max/12 Mini/SE/11/11Pro/11 Pro Max/Xr/Xs/ Xs Max/X/8/8 Plus; Samsung Galaxy S22/S22 Ultr…</span></span>;Wireless;15 Watt;【Ultimatives kabelloses ladepad】Polmxs 15W schnelle kabellose Autoladematte lädt Ihre Qi-kompatiblen Geräte bequem auf. Legen Sie Ihr Gerät einfach in die Mitte des Pads und der Ladevorgang beginnt sofort. Universelles schnelles kabelloses Laden, das sicher bis zu 15W Leistung liefert und mit praktisch jedem Qi-fähigen Gerät kompatibel ist, einschließlich: 15W für LG, 10W für Samsung, 7,5W für iPhone und 5W für Qi-fähige Geräte. Hinweise: Zum schnellen Aufladen ist ein QC3.0-Ladegerät erforderlich (INBEGRIFFEN).|【Intelligentes 2 in 1 Design】 Induktive ladestation auto mit separatem Außenpolster bietet erhöhte Telefonsicherheit und mehrere Befestigungsmöglichkeiten. Passen Sie das kompakte wireless car charger sauber in Ihre Mittelkonsole an, während Sie das äußere Pad auch verwenden, um ein anderes Telefon zu halten; mit Aussparungen zum Halten Ihres Telefons im Querformat (GPS).|【Sicherer Pad-Griff und Leuchten im Dunkeln】 Entworfen mit hochwertigem PVC-Material, das Ihr Telefon während des Ladevorgangs festhält. Das äußere Polster hat vier Ecklippen, um zu verhindern, dass Ihr Gerät abrutscht, und bietet zusätzliche Sicherheit. Doppelseitige Aufkleber enthalten, um das Pad sicher auf den meisten Oberflächen zu befestigen, indem die Unterseite des Pads stark angesaugt wird. Suchen Sie nie nach dem wireless car charger im Dunkeln mit leuchtenden Streifen.|【Erweiterte Sicherheit und Hüllenfreundlich】 Ausgestattet mit Temperaturkontrolle, Überladeschutz und Überspannungsschutz gewährleistet die Sicherheit von Ihnen und Ihrem Telefon; für konsistentes und zuverlässiges schnelles kabelloses Laden. Das kfz handyhalterung induktion lädt direkt über Handyhüllen mit einer Dicke von bis zu 4 mm (ausgenommen Hüllen mit Magnet- oder Metallbefestigungen), sodass Sie die Handyhülle nicht entfernen müssen.|【Was Sie bekommen】 1x car wireless charger mit Typ-C-Kabel (1 Meter Länge), 1x Außenpolster, 6x doppelseitiger Aufkleber, 1x 36W PD Kabelloses Autoladegerät, 1x Bedienungsanleitung, 1 Jahr Garantie. Hinweis: Nicht alle Telefone sind mit dem kabellosen Laden kompatibel. Bitte stellen Sie sicher, dass Ihr Telefon drahtlos aufgeladen wird. Sie können in unserer Liste unten von Telefonen nachsehen, die drahtlos aufgeladen werden können, oder uns mit Ihren Fragen kontaktieren.');
INSERT INTO `qi-ladegerät` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Qi-Ladegerät/Romdink C1 Auto-Ladegerät.webp;', 'Romdink C1 Auto-Ladegerät', 'https://www.amazon.de/Romdink-Auto-Ladeger%C3%A4t-Wireless-Anti-Rutsch-Auto-Charging/dp/B07STBDS6H/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2V7CPUMLXKZ9N&keywords=Romdink+C1+Auto-Ladeger%C3%A4t&qid=1667039904&qu=eyJxc2MiOiIxLjE5IiwicXNhIjoiMC43NiIsInFzcCI6IjAuMzYifQ%3D%3D&sprefix=%2Caps%2C80&sr=8-3', '18,39', 4.2, 1323, 0, 'Romdink;9 Volt;Handys;Samsung;USB;5 Watt;Aus hochwertigem silikonkautschuk gefertigt, ist es verschleißfest und langlebig.|Die Schnellladetechnologie sorgt für mehr Effizienz und weniger Wärme beim Laden.|Kann ein Ständer sein, der Ihr Telefon auf dem Armaturenbrett aufrecht hält, um eine einfache Anzeige und freihändige Navigation zu ermöglichen.|Ausgestattet mit einer rutschfesten Gummibasis fällt sie nicht vom Armaturenbrett, selbst wenn das Auto bergauf, bergab oder sogar auf holprigen Straßen fährt.|Es wird nicht nur in Ihrem Auto verwendet, sondern kann auch in Ihrem Büro oder in Ihrem Zimmer verwendet werden.');
